import React, { Component } from 'react';
import Skills_Comp from './Skills_Comp';


export default class About extends Component {
  render() {
    let resumeData = this.props.resumeData;
    const this_elem = <h1 style={{ color: 'red' }}>Hello world</h1>
    this.state = {color: "White", font: "Helvetica Neue"};

    return (
      <section id="about">


         <div className="nine columns main-col">
            <div className="row">

               <div className="columns Skills-details">

                  <h2>Skills</h2>
                     <Skills_Comp  color = {this.state.color}/>

               </div>
            </div>
         </div>

      </section>
    );
  }
}
